import React from 'react';

class CreateParty extends React.Component {
    constructor(props) {
        super(props);

        this.state({
            username: ''
        })
    }
    
    createParty(_joinGame) {

        // Swap Scene
        _joinGame();
    }

    handleChange(event) {
        this.setState({value: event.target.value});
    }

    render() {
        return (
            <div>
                <h1>{this.state.username}</h1>
                <label>
                    Name:
                    <input type="text" name="name" onChange={this.handleChange} />
                </label> <br/>
                <button onClick={() => this.createParty(this.props.joinGame)}>Create Party</button> <br/>
                <button onClick={this.props.backClick}>Back</button>
            </div>
        );
    }
}

export default CreateParty;
